Los ejemplares adultos son vulnerables a pocos depredadores naturales, pero es presa de leones marinos, orcas y tiburones. Entre los humanos, su carne está considerada como una exquisitez en algunas partes del mundo, como Japón, Corea y Taiwán, pero la venta de su carne está prohibida en Europa. A menudo estos peces quedan accidentalmente atrapados en redes de pesca y también pueden dañarse o morir debido a encuentros con desechos flotantes, como bolsas de plástico.

