This moose seemed to take the state motto of "Live Free or Die" to a whole new level. 

We had moose everywhere. They would even come up to the back porch of our house when I was little. 😳

I've never seen a single moose since moving to #Colorado 15 years ago. So I feel like the sightings last weekend in #Wyoming more than made up for it! 

